import React, { useState } from "react";

const UserList = (props) => {
  return (
    <ul className="user-list">
      {props.users.map((user) => (
        <li className="user-item" key={user.id} id={user.id}>
          {user.name}
        </li>
      ))}
    </ul>
  );
};

export default UserList;
